const a={a1:"导航转换是在应用的不同状态间移动，例如从高级视图进入详细视图。",a2:"大多数（但不是全部）转换都在自然的层次之间。这些时刻应该通过应用的不同状态来反应出用户的前进方向。",a3:"层次结构和海拔高度",a4:"当元素升高并展开，海拔高度的改变指示出了焦点从<strong>父级移动到了子级</strong>。",a5:"<strong>同级转换</strong>出现在处于同一层次结构的元素之间，没有海拔高度的变化。",a6:"父级到子级",a7:"同级到同级",a8:"探索应用更深层的视图，是从父屏幕开始不断深入探索的层级之途。在那里，用户可以探索多个可能的子屏幕，也就是父屏幕的子屏幕。",a9:"在 Material Design 中，海拔高度的变化表示从父元素到子元素的焦点变化。",a10:"海拔高度和扩展",a11:"用户触摸的表面应该从原来的地方升高并展开。这种扩展和动画使用了材料运动曲线，在自然的运动中强调了离开了父级，向目标（子元素）移动。",a12:"父级到子级的转换动画",a13:"父级到子级的转换动画",a14:"<strong>同级转换</strong>出现在处于同一层次结构的元素之间，没有海拔高度的变化。",a15:"固定海拔高度",a16:"例如，当用户通过选项卡来导航时，是不会发生海拔高度变化的。每个选项标签的内容都和表面在同一海拔高度。新内容从右侧滑入，同时同级的内容向左移动到屏幕外。",a17:"同级转换",a18:"同级转换的动画",a19:"Material Design 中的导航转换在不同状态间移动"};export{a as zhCn};
